    "1987 wolf survey, Nowitna National Wildlife Refuge",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:03:10.244903",nt"name": "1987-wolf-survey-nowitna-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "A total of 60 observations of wolf track(s)
    were recorded and 12 wolves were observed (groups of 3, 3, 4 and. 2) (Figure 2).
    Tracks were observed along all of the transects flown. As expected, wolf activity
    was most concentrated in drainages, i.e. along the Yukon and Nowitna rivers and
    their tributaries. Although no definitive conclusions can be drawn from the number
    of wolves seen, it is highly unlikely that this type of survey would result in nearly
    20% of the total wolf population being observed. This lends further credence to
    our belief that the wolf numbers derived are minimum estimates. Known harvest levels
    for wolves have been relatively low in recent years (3 in 1985, 3 in 1986), although
    refuge trappers have reported an increase in wolf numbers. Land and shoot wolf tapping
    activity has apparently increased on the refuge in 1987, and at least 12 wolves
    have been harvested this spring. An accurate determination of the Nowitna NWR wolf
    population has become necessary in light of the recent decline in the area's moose
    population.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
